AllCast TV Screen Mirroring will record your iPhone or iPad screen for casting or streaming in real time to your TV in high quality!
Easy to use: No TV app needed, just run the app, select TV and start mirror your screen!
Mirror your device to any Smart TV in HD quality! AllCast TV Screen Mirroring  mirrors entire screen, including photos, videos, apps, games, websites, documents, presentations!

The possibilities are endless! With our app you can:
- Make presentations in business meetings on big screen TV;
- Watch entire websites or documents for review on TV;
- Stream online movies and videos from browser to TV;
- Mirror any application or games (for watching) wirelessly on your iPhone/iPad screen to TV;
- Streaming or casting photos, videos, music from your iPhone/iPad to TV;

How to use?
- Connect your iPhone/iPad and your TV to the same WiFi network. Read help for more info!
- Open the app and select your TV;
- If TV is asking for connection, please allow your TV connect to your iPhone/iPad (use tv remote);
- Press Start Mirroring button to start mirroring screen on your TV;
- Stop mirroring by clicking on top red bar of your iPhone/iPad or open the app and press Stop Mirroring;

